import React, { Component } from 'react';

var users = [ {
  name : 'Cicily',
  age : 38
},{
  name : 'Alec',
  age : 44
},{
  name : 'Alistair',
  age : 2
},{
  name : 'Avery',
  age: 5
} ];

function GetList() {
    var namesList = users.map(function(user, index){
        			return <Welcome key={index} name={user.name} age={user.age} />;
      			})
    return  <ul>{ namesList }</ul>

};


function Welcome(props) {
  return <li>Hello, {props.name} you are  {props.age} years old. </li>;
}

class UserList extends Component {
  render() {
    return (
      <div>
        <GetList />
      </div>
    );
  }
}

export default UserList;
